import './App.css';
import ResponsiveAppBar from './components/AppBar';
import IntroBox from './components/IntroBox';
import ProjectsBox from './components/ProjectsBox';
import Stack from '@mui/material/Stack';

function App() {
  return (
    <div className="App">
      <ResponsiveAppBar />
      <div className='mx-auto container'>
      <Stack spacing={2}>
        <IntroBox />
        <ProjectsBox />
      </Stack>
      </div>


    </div>
  );
}

export default App;
